import styled from 'styled-components';

export const Container = styled.div`

display: flex;
height: 100vh;
align-items: center;
text-align: center;
flex-direction: column;
justify-content: center;
background-color: #F3F1F1;

.farmLogo{
    display: block;
    margin-left: auto;
    margin-right: auto;
    width: 30%;
}

.myAccountForm{
    margin-top: 2%;
    min-width: 100%;
}

.labelMyAccount{
    width: 11%;
    padding: 12px 12px 12px 0;
    display: inline-flex;
}

`;
